import React from 'react';
import './LoginFormPage.css';
import fwLogo from '../assets/logo.png';
import loginVid1 from '../assets/video/4505482-uhd_4096_2160_25fps.mp4';
import { useNavigate } from 'react-router-dom';

const LoginFormPage = () => {
  const navigate = useNavigate();
  return (
    <div className="loginform-page-container">
      <div className="loginform-left">
        <img src={fw} alt="Logo" className="loginform-logo" />
        <h2>LOG IN</h2>
        <form className="loginform-form">
          <label htmlFor="email">EMAIL</label>
          <input type="email" id="email" name="email" autoComplete="username" />
          <label htmlFor="password">PASSWORD</label>
          <input type="password" id="password" name="password" autoComplete="current-password" />
          <div className="forgot-password">Have you forgotten your password?</div>
          <button type="submit" className="login-btn">LOG IN</button>
          <button type="button" className="register-btn" onClick={() => navigate('/register')}>REGISTER</button>
        </form>
      </div>
      <div className="loginform-right">
        <video src={loginVid1} className="login-img" autoPlay loop muted playsInline />
      </div>
    </div>
  );
};

export default LoginFormPage;
